import React from 'react';

import NotFoundMessage from 'components/commons/NotFoundMessage/NotFoundMessage';

import styles from './NotFound.module.scss';


function NotFound() {

   return (
      <main>
         <h2 className = { styles.title }>404 – Lost in traffic.</h2>
         <NotFoundMessage message='Page not found. The page you’re looking for doesn’t exist or has been moved.'/>
      </main>
   )
}

export default NotFound;
